import styled from 'styled-components';

const Styled = styled.section`
  .mapouter {
    position: relative;
    /* text-align: right; */
    /* height: 300px; */
    width: 100vw;
  }

  .map--Box {
    width: 100vw;
    height: 400px;
  }
`;

const MapBox = () => {
  return (
    <Styled>
      <div class='mapouter'>
        <div class='gmap_canvas'>
          <iframe
            className='map--Box'
            id='gmap_canvas'
            src='https://maps.google.com/maps?q=%20960%20W%2018th%20St%2C%20Chicago%2C%20IL%2060608&t=&z=15&ie=UTF8&iwloc=&output=embed'
            frameborder='0'
            scrolling='yes'
            marginheight='0'
            marginwidth='0'
          ></iframe>
        </div>
      </div>
    </Styled>
  );
};

export default MapBox;
